import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import topic0 from "assets/img/topics/topic0.png";
import topic1 from "assets/img/topics/topic1.png";
import topic2 from "assets/img/topics/topic2.png";
import topic3 from "assets/img/topics/topic3.png";
import topic4 from "assets/img/topics/topic4.png";
import topic5 from "assets/img/topics/topic5.png";
import topic6 from "assets/img/topics/topic6.png";
import {
  Card,
  Col,
  CardImg
} from 'reactstrap';
import FadeIn from 'components/FadeIn';
import Row from 'reactstrap/lib/Row';

export default function TopicsChart() {
  const [value, setValue] = React.useState('1');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%', typography: 'body1' }}>
      <TabContext value={value}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
          <TabList centered onChange={handleChange} aria-label="lab API tabs example">
            <Tab label="T√≥pico 0" value="0" />
            <Tab label="T√≥pico 1" value="1" />
            <Tab label="T√≥pico 2" value="2" />
            <Tab label="T√≥pico 3" value="3" />
            <Tab label="T√≥pico 4" value="4" />
            <Tab label="T√≥pico 5" value="5" />
            <Tab label="T√≥pico 06" value="6" />
          </TabList>
        </Box>
        <TabPanel value="0">
          <Row>
            <div style={{width: "700px"}}>
          <p>Sa√∫de</p>
          <p>Este t√≥pico retrata sdjsdhsjdndsjfndjfnjfnjfbnjfgbjfngjnf </p>
          </div>

          <CardImg src={topic0} style={{width:"80px", marginTop:"20px", marginLeft:"0px"}}/>
          </Row>
        </TabPanel>
        <TabPanel value="1">Item Two</TabPanel>
        <TabPanel value="2">Item Three</TabPanel>
        <TabPanel value="3">Item Three</TabPanel>
        <TabPanel value="4">Item Three</TabPanel>
        <TabPanel value="5">Item Three</TabPanel>
        <TabPanel value="6">Item Three</TabPanel>
      </TabContext>
    </Box>
  );
}
